  \"2016-07-27T22:20:27.255453\",\n\t\"name\": \"matagorda-island-unit-aransas-national-wildlife-refuge-annual-narrative-report-calendar-19-dff26\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Annual Narrative Report for the Matagorda
  Island Unit of Aransas National Wildlife Refuge summarizes refuge activities during
  1987.  The report begins with information about the yearu2019s highlights and climatic
  conditions.   Land acquisition- including fee title, easements, and other acquisitions-
  is also covered.  The report includes a planning section which discusses the master
  plan, the management plan, public participation, compliance with Environmental Resource
  Mandates, and research/investigations.  Refuge administration is outlined; lists
  of personnel, youth programs, manpower programs, and volunteer programs are given.
  \ Habitat management is also covered.  Subjects include general habitats, wetlands,
  grasslands, grazing, and fire management.  The wildlife section of the report discusses
  wildlife diversity, endangered/threatened species, waterfowl, marsh/water birds,
  shorebirds, raptors, game animals, marine mammals, and fisheries.  The public uses
  of the refuge described in this report include general use, outdoor classrooms,
  interpretive foot trails, tours, hunting, fishing, and wildlife observation.  The
  equipment and facilities section of the report provides information about major
  maintenance, communication systems, computer systems, and energy conservation.\",\n\t\"license_title\":
